import { useState } from "react";

const Prices = (props) => {
  const [currency, setCurrency] = useState("USD");

  if (currency === "USD") {
    list = <li>HElloooo</li>;
  } else {
    list = <li>Byyyyy</li>;
  }

  return <div>{list}</div>;
};

export default Prices;
